import React, { Component } from 'react';
import './contact.css';

class Portfolio extends Component {

  render() {
    return (
        
    	<div id='contact'>
        <div style={{position:'absolute',top:1400}}>
            <h1> CONTACT ME</h1>
            <div className='container'>
                <div className='grid-item'></div>
                <div className='grid-item'></div>
                <div className='grid-item'></div>
                <div className='grid-item'></div>       
            </div>
            <div className='mail'></div>
        </div>
    	</div>
    );
  }
}

export default Portfolio;
